Defendant Cassandra M. Hathaway in court with attorney Paul S Crawford.  David A Feiss appeared for the State of Wisconsin.
Sentencing proceeds. No corrections made to PSI report. Statements made by the State, defense counsel and defendant. 

Both State and Defense Counsel inform Court that $1,000.00 in money orders has been given to the State on today by Defendant for partial restitution to Penelope K.  which will result in a reduction of the $3,495.74 restitution amount owed this victim.

Court sentenced defendant to serve a term of IMPRISONMENT in the Wisconsin State Prisons for 4 YEARS.  INITIAL CONFINEMENT of 2 YEARS and EXTENDED SUPERVISION of 2 YEARS. Credit given for 0 days time served if revoked.  25% of prison funds, collected by Department of Corrections, to go toward all court ordered monetary obligations, with restitution to Penelope K having first priority, with restitution to BMO Harris Bank having second priority, and all other monetary obligations, thereafter, if revoked.
.
COURT STAYS sentence and places defendant on PROBATION for 4 YEARS.
-
Court orders defendant to serve 6 MONTHS CONDITION TIME IN THE HOUSE OF CORRECTION, with HUBER RELEASE for WORK, WORK SEARCH, and TREATMENT.   The FIRST THREE MONTHS of Condition Time is TO BE SERVED, and the LAST THREE MONTHS TO BE USED AT THE DISCRETION OF PROBATION AND PAROLE AGENT.  Defendant to report to the House of Corrections on 06-27-2014.  Sentencing Referral Form SIGNED AND FILED.
-
CONDITIONS OF PROBATION/EXTENDED SUPERVISION: 
-AODA assessment and cooperate with any programs deemed necessary by the probation department;
-absolute sobriety, no alcohol, no drugs if AODA ASSESSMENT deems this necessary;
-no gambling or frequenting of gambling establishments;
-random urine screens; if AODA ASSESSMENT deems this necessary;
-pay restitution in the reduced amount of $2,495.74 to Penelope K and $40,759.00 to BMO Harris Bank); failure to pay shall result in a civil judgment being entered;
-provide a DNA sample;
-pay MANDATORY DNA surcharge; failure to pay shall result in a civil judgment being entered;
-pay all court costs, fees, and surcharges; failure to pay shall result in a civil judgment being entered;
-pay all applicable fees of supervision; failure to pay shall result in a civil judgment being entered;
-no contact with victim, Penelope K.
-
-  A payment plan for all monetary obligations is to be established by Department of Corrections, Probation and Parole.  All unpaid monetary obligations at the end of the period will convert to a civil judgment.
-  No Cash Bail was posted in this matter.
-  Firearm/Voting Rights/Civil Judgment Warnings given.
-  
Court advised defendant on Extended Confinement or "bad time".
Defendant IS eligible for Challenge Incarceration Program.
Defendant IS eligible for the Wisconsin Substance Abuse Program.
Appeal rights given. Written Explanation of Determinate Sentence and Notice of Right to Seek Postconviction Relief received and filed. Acknowledgment of ineligibility  Copies given to defendant.
